### nthIter
- addErrorUtils

**getValue** <br/>
Get item from key (as a dot (`.`) separated string)
```js
/**
* @param {Object} obj
* @param {String} key (key must be string)
* @return value of the key passed 
*/
getValue(
    {
        'hello': {
            'world' : 1
        }
    },
    'hello.world'
); 
// -> 1
getValue(
    {
        'hello': {
            'world' : [1]
        }
    },
    'hello.world[0]'
); 
// -> 1
getValue(
    ['hello dr', 'how are you'],
    '[1]'
); 
// -> 'how are you'
getValue(
    ['hello dr', 'how are you'],
    '[1][0]'); 
// -> undefined
getValue(
    [{
        'order': 1,
        'name': 'hellow dr'
    },
    {
        'order': 2,
        'name': 'how are you'
    }
    ],
    '[1].order'
); 
// -> 2
getValue(
    ['hello dr', 'how are you'],
    '[0][1]'); 
// -> undefined
```
